    @Test
    public void acionamentoEstagioDispensavelSendoQueOMesmoEDuplo() throws IOException {
        inicioExecucao = new DateTime(2016, 12, 20, 11, 10, 0);
        controlador = getControlador();

        Plano plano = controlador.findAnelByPosicao(2).findPlanoByPosicao(2);
        EstagioPlano estagioPlano = plano.getEstagiosOrdenados().get(3);
        estagioPlano.setEstagioQueRecebeEstagioDispensavel(estagioPlano.getEstagioPlanoAnterior(plano.getEstagiosOrdenados()));

        assertTrue(controlador.isCompleto());

        Motor motor = new Motor(controlador, inicioExecucao, this);

        Anel anel = getAnel(2);
        Pair<Integer, TipoDetector> detector = getDetector(anel, 1);

        avancarSegundos(motor, 192);
        motor.onEvento(new EventoMotor(inicioExecucao.plusSeconds(192), TipoEvento.ACIONAMENTO_DETECTOR_PEDESTRE, detector, 2));
        avancarSegundos(motor, 500);

        //Sincronizados
        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(170)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(209)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(240)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(279)).get(1).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(310)).get(1).getEstagio().getPosicao().intValue());

        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(170)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(199)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E3", 3, listaEstagios.get(inicioExecucao.plusSeconds(209)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(240)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E3", 3, listaEstagios.get(inicioExecucao.plusSeconds(269)).get(2).getEstagio().getPosicao().intValue());
        assertEquals("Estágio E1", 1, listaEstagios.get(inicioExecucao.plusSeconds(310)).get(2).getEstagio().getPosicao().intValue());
    }

